import './App.css';
import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom'
import Dashboard from './Pages/Dashboard';
import Home from './Pages/Home';
import Submissions from './Pages/Submissions';
import Profile from './Pages/Profile';
import Settings from './Pages/Settings';
import Error from './Pages/Error';
import Tabs from '@mui/material/Tabs';
import Tab from '@mui/material/Tab';

function App() {

  const [value, setValue] = React.useState(0);

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  return (
    <Router>
      <head>
        <meta name="viewport" content="width=device-width, initial-scale=1, maximum-scale=1"></meta>
      </head>
      <body>
        <div className='header'>
          <Link to="/" style={{ textDecoration: 'none' }}>
          <img className='header-logo' src={require("./header.png")} alt='ChuCode'></img>
          </Link>
          <nav className='nav'>
            <Tabs value={value} onChange={handleChange} textColor="inherit" indicatorColor="inherit" style={{indicatorColor: 'white'}}>
              <Tab component={Link} label="Home" to="/"/>
              <Tab component={Link} label="Dashboard" to="/dashboard"/>
              <Tab component={Link} label="Submissions" to="/submissions"/>
              <Tab component={Link} label="Problem of the Day" to="https://leetcode.com/problems/two-sum/"/>
              <Tab component={Link} label="Profile" to="/profile"/>
              <Tab component={Link} label="LeetCode" to="https://leetcode.com/problemset/all/"/>
              <Tab component={Link} label="Settings" to="/settings"/>
            </Tabs>
          </nav>
        </div>
        <Routes>
          <Route exact path='/' element={<Home />} />
          <Route path='/dashboard/:username?' element={<Dashboard />} />
          <Route path='/submissions' element={<Submissions />} />
          <Route path='/profile' element={<Profile />} />
          <Route path='/settings' element={<Settings />} />
          <Route path='*' element={<Error />} />
        </Routes>
        <div></div>
      </body>
    </Router>
  );
}

export default App;
